import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Route,
    Link,
    Switch,
    Redirect
} from "react-router-dom";
import { InProzent } from './components/inProzent';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    render() {
        return ( <
            div className = "App" >
            <
            header className = "App-header" >
            <
            Router >
            <
            div >

            <
            Switch >
            <
            Route path = "/"
            exact component = { Home }
            /> <
            Route path = "/Rabattrechner"
            component = { InProzent }
            /> <
            Redirect from = "/old-match"
            to = "/will-match" / >
            <
            Route path = "/will-match"
            component = { WillMatch }
            /> <
            Route component = { NoMatch }
            /> <
            /Switch> <
            /div> <
            /Router> <
            ul >
            <
            li >
            <
            Link to = "/" > Home < /Link> <
            /li> <
            li >
            <
            Link to = "/Rabattrechner" > Rabattrechner < /Link> <
            /li> <
            li >
            <
            Link to = "/old-match" > Old Match, to be redirected < /Link> <
            /li> <
            li >
            <
            Link to = "/will-match" > Will Match < /Link> <
            /li> <
            li >
            <
            Link to = "/will-not-match" > Will Not Match < /Link> <
            /li> <
            li >
            <
            Link to = "/also/will/not/match" > Also Will Not Match < /Link> <
            /li> <
            /ul> <
            /header> <
            /div>
        );
    }
}



function Home() {
    return ( <
        p >
        A < code > & lt; Switch > < /code> renders the first child <code>&lt;Route></code > { " " }
        that matches.A < code > & lt; Route > < /code> with no <code>path</code > always matches. <
        /p>
    );
}

function WillMatch() {
    return <h3 > Matched! < /h3>;
}

function NoMatch({ location }) {
    return ( <
        div >
        <
        h3 >
        No match
        for < code > { location.pathname } < /code> <
        /h3> <
        /div>
    );
}
export default App;

